      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "1. Es sucht jemand einen silbern Schreibzeug mit aller Zugehörd und schöner Fason, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "2. Man begehrt eine Chaise mit 4 Rädern zu er- wähnen 3 Plätzen und in einem Pferd sammt ge- hörigem Geschirr, der Liebhaber ist im Berichtshaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "3. Wer hier oder auf dem Land noch neuen Krämer- & Brandwein Ohmweissen zu verkaufen hat, kan im Berichtshaus einen Käufer darzu pernehmen, wie auch eine mittelmäßigen Sponton, so ebenfalls begehrt wird, beyde ohne Entgeld im Berichtshaus ist zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "4. Es sucht jemand eine gute, solide und unge- fehrte einen Baum haltende Heuversirung zum tragen oder zum Fuhr, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "5. Es sucht jemand einen möbligen Kron- leuchter mit 8 Lichtstöcken, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "6. Es verlangt jemand eine nicht gar grosse eiserne WerkKast zu kaufen, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "7. Es verlangt jemand einen glatten nußbäumern zweÿthürigen Kasten, der Liebhaber ist im Berichtshaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "8. Man verlangt einen noch guten Kachel-Ofen mittelmäßiger Grösse mit oder ohne Fuß, der Liebhaber ist im Berichtshaus zu erfragen; seint aber keinen Verzug."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "ntokens": null,
      "text": "1. Ein Locament mitten im Offenburgs-Hof, wie der Augenschein zeigen wird, auf nächst Pfingst- oder Pfingst-Kronfassen zu beziehen."
    },
    {
      "date": null,
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "ntokens": null,
      "text": "2. Ein sauberes Locament an der Spalen von einer Stuben und NebenKammern, oder nach Belieben zwei Kammern sammt einem kleinen Sommerhaus, alles auf einem Boden, und nach Belieben Stallung und Scheubinge, auf Pfingst-Kronfassen zu beziehen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "3. Ein Locament mit einem schönen Laden und Laden-Stübchen nebst einem grossen Sommer- haus, Stuben, Küche, 2 grosse Kammern, einem besonderen Keller, Holzhaus, ein beschlo- senes Bauchhaus, auf der Eisengass, im Berichtshaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "4. Ein Locament in der Strossgass von einer Stu- be, 2 Kammern und Platz zum Hof, auf Pfingst-Kronfassen zu beziehen, im Berichtshaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "5. Ein Locament für 2 Personen in der Weißen Gass, bestehend aus einem Stübchen und Alle- rofen, Platz zum Hausrath zu stellen, auf ei- nem Boden, wie auch Platz zum Holze, Brun- nen zu haben, 2 bis 3 Pfund Zins des Jahres, kann gleich bezogen werden, im Berichtshaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "6. Ein schönes Locament ebenes Fusses auf ei- nem Boden von 3 Stuben, einem grossen Saal, Kammer, Küche, Keller, Platz zum Hof, Zutritt zum Bauchhaus, und, so belieb- ig, einem Garten in der Neuen Vorstadt, im Berichtshaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "7. Eine grosse doppelte Frucht-Schütte aus der C. C. Gesellschaft zum hohen Nutz."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "8. Bis den 1sten bis wird eine säugende Hündin begehrt, um eine junge Hündin aufzuzie- hen; gegen eine Erkanntniß, wo sich anzumelden, ist im Berichtshaus ohne Entgeld zu vernehmen."
    },
    {
      "date": null,
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "9. Auf künftige Beziehung ist unter der St. Peters-Schul ein geräumiger Magazin zu verlas- sen, darum sich in dem Schulhaus anzumelden."
    },
    {
      "date": null,
      "tags_section": "Kost, Information und Bedienungen werden angetragen und begehrt:",
      "ntokens": null,
      "text": "1. In ein wackeres protestantisches Haus in denen Niederlanden wird ein Candidatvs Theologiae, der neben anderen auch die französische Sprache verstünde, zu einem Haus-Präceptor begehrt, weshalb sich im Berichtshaus zu melden."
    },
    {
      "date": null,
      "tags_section": "Kost, Information und Bedienungen werden angetragen und begehrt:",
      "ntokens": null,
      "text": "2. Man verlangt einen Menschen in eine Fabrik, der sich zu allerley Haus-Geschäften brauch- bar ließe, im Berichtshaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": "Kost, Information und Bedienungen werden angetragen und begehrt:",
      "ntokens": null,
      "text": "3. Man sucht einen Stadtknecht in ein Wirths- haus, im Berichtshaus zu erfragen."
    }
  ]
}
